            "fr": "Lorsqu’un identifiant est créé sur la base de données d’authentification, telles que les coordonnées associées aux comptes en ligne que vous avez créés sur des sites Web ou des applications (par ex. adresse e-mail, numéro de téléphone) ou des identifiants client (par ex. identifiant fourni par votre opérateur de télécommunications), il peut être utilisé pour vous reconnaître sur les sites Web, les applications et les appareils lorsque vous êtes connecté avec les mêmes coordonnées."
