            "fr": "Votre activité en ligne, telle que les sites Web que vous consultez, les applications que vous utilisez, le contenu que vous recherchez sur ce service, ou vos interactions avec du contenu ou des publicités, telles que le nombre de fois que vous avez vu un contenu ou une publicité spécifique ou si vous avez cliqué dessus."
